import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to load (first 8 products)
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Take screenshot of featured products
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_featured_products.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_featured_products.png'));

    // Find the first product card in the grid
    const firstProductCard = await page.$('#productsGrid .product-card');
    if (!firstProductCard) throw new Error('First product card not found');

    // Scroll into view
    await firstProductCard.scrollIntoViewIfNeeded();

    // Find the "Add to Cart" button inside the first product card
    const addToCartBtn = await firstProductCard.$('button.add-to-cart');
    if (!addToCartBtn) throw new Error('"Add to Cart" button not found in first product card');

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Wait for notification that confirms add to cart
    await page.waitForSelector('.notification.success', { timeout: 3000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Wait for cart count to update
    await page.waitForSelector('#cartCount', { timeout: 2000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Click on the cart to open the cart modal
    const cartDiv = await page.$('.cart');
    if (!cartDiv) throw new Error('Cart element not found');
    await cartDiv.click();

    // Wait for the cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 3000 });
    await page.waitForSelector('#cartItems', { timeout: 2000 });

    // Take screenshot of the cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modal.png'));

    // Extract cart item details
    const cartItems = await page.$$eval('#cartItems .cart-item', items =>
      items.map(item => {
        const title = item.querySelector('.cart-item-title')?.textContent?.trim() || '';
        const price = item.querySelector('.cart-item-price')?.textContent?.trim() || '';
        const quantity = item.querySelector('.quantity')?.textContent?.trim() || '';
        return { title, price, quantity };
      })
    );

    // Extract the notification message
    const notificationMsg = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first featured product to cart and verified cart contents",
      extractedData: {
        cartCount: cartCountText,
        notification: notificationMsg,
        cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
